import React from 'react';
import styled from 'styled-components';
import {
    Button
  } from "antd";

function Footer() {
    return (
        <FooterBtn>
            <Button type="button">Proceed</Button>
        </FooterBtn>
    )
}

export default Footer;

const FooterBtn = styled.div`
     width:150px;
        height:30px;
       display: inline-block;
    text-align:center;
    border-radius:10px;
    color: white;
    background:#500E4B;
    border: 3px solid #500E4B;
  text-align: center;
    cursor: pointer;
    margin-bottom:3rem;
`;
